import React, { Component } from "react";
import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel, Input, Button, Divider } from "antd";
import Link from "next/link";
import {AndroidOutlined} from '@ant-design/icons'
// import "../../static/css/style.scss";
class SideMenuLeft extends Component {
  state = {};

  render() {
    return (
      <Layout className="list">
        <Row >
        <AndroidOutlined />                  
        <Link href="/home">
            <a title="About home page">About</a>
          </Link>
          </Row>
          <Row>
          <AppleOutlined />
          <Link href="/">
            <a title="About home page">Developer</a>
          </Link>
          </Row>
          <Row>
          <IeOutlined />
          <Link href="/">
            <a title="About home page">Career</a>
          </Link>
          </Row>
          <Row>
          <GithubOutlined />
          <Link href="/">
            <a title="About home page">Term and Condition</a>
          </Link>
          </Row>
          <Row>
          <TwitterOutlined />
          <Link href="/">
            <a title="About home page">Help</a>
          </Link>
          </Row>
      </Layout>
    );
  }
}

export default SideMenuLeft;
